import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [totalStudents, setTotalStudents] = useState(0);
  const [vaccinatedCount, setVaccinatedCount] = useState(0);
  const [allDrives, setAllDrives] = useState([]);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Fetch all students
        const studentsRes = await axios.get('http://localhost:5000/students');
        const students = studentsRes.data;
        setTotalStudents(students.length);

        // Count vaccinated students
        const vaccinated = students.filter(student => student.vaccinationStatus === 'Vaccinated');
        setVaccinatedCount(vaccinated.length);

        // Fetch vaccination drives
        const drivesRes = await axios.get('http://localhost:5000/vaccination-drives');

        // Parse and sort drives by date
        const sortedDrives = drivesRes.data
          .map(d => ({
            ...d,
            dateObj: new Date(d.date) // parse date
          }))
          .sort((a, b) => a.dateObj - b.dateObj);

        const finalDrives = sortedDrives.map(({ dateObj, ...rest }) => rest);
        setAllDrives(finalDrives);

      } catch (err) {
        console.error('Error fetching dashboard data:', err.message);
      }
    };

    fetchDashboardData();
  }, []);

  const vaccinatedPercentage = totalStudents === 0 ? 0 : ((vaccinatedCount / totalStudents) * 100).toFixed(2);

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h2>ðŸ“Š Dashboard</h2>

      <div style={{ display: 'flex', gap: '20px', marginBottom: '30px' }}>
        <div style={cardStyle}>
          <h3>Total Students</h3>
          <p>{totalStudents}</p>
        </div>

        <div style={cardStyle}>
          <h3>Vaccinated Students</h3>
          <p>{vaccinatedCount}</p>
        </div>

        <div style={cardStyle}>
          <h3>Vaccination %</h3>
          <p>{vaccinatedPercentage}%</p>
        </div>
      </div>

      <h3>ðŸ“… Upcoming Vaccination Drives</h3>
      <table style={tableStyle}>
        <thead>
          <tr>
            <th>Vaccine</th>
            <th>Date</th>
            <th>Classes</th>
            <th>Doses</th>
          </tr>
        </thead>
        <tbody>
          {allDrives.length > 0 ? (
            allDrives.map((drive, index) => (
              <tr key={index}>
                <td>{drive.vaccine}</td>
                <td>{drive.date}</td>
                <td>{drive.classes}</td>
                <td>{drive.doses}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" style={{ textAlign: 'center' }}>No drives scheduled</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

const cardStyle = {
  flex: 1,
  background: '#f0f0f0',
  padding: '20px',
  borderRadius: '8px',
  textAlign: 'center'
};

const tableStyle = {
  width: '100%',
  borderCollapse: 'collapse',
  marginTop: '10px',
  border: '1px solid #ccc'
};

export default Dashboard;
